 Terminating a C program is simple. You can terminate a C program by using the `exit()` function. The `exit()` function is a part of the `stdlib.h` library and it is used to terminate the program immediately.

Here is a simple example:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    printf("Inside main function\n");
    exit(0);
    printf("This line will not be executed\n");
}
```

In this example, the `exit(0);` statement terminates the program immediately, so the `printf("This line will not be executed\n");` statement is not executed.

The `exit()` function takes an integer as an argument. The argument is the status of the program termination. If the argument is 0, it means the program has terminated normally. If the argument is a non-zero value, it means the program has terminated abnormally.

For example, if you want to terminate the program with a status of 1, you can use `exit(1);`. This is often used in error handling scenarios.
